import React from 'react';
import './App.css';
import Story from './components/Story';

function App() {
  const fetchStories = async () => {
    const list = await fetch("https://sv-reqres.now.sh");
    console.log(list.data);
  }
  fetchStories();
  return (
    <Story />
  );
}

export default App;
